import React from 'react';
import Sidebar from './components/Sidebar';
import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Sidebar />}></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
